import React, { useState } from 'react';
import Calendar from 'react-calendar';

const App = () => {
    const [value, setValue] = useState(new Date());

    function onChange(nextValue) {
        setValue(nextValue);
    }

    return (
        <Calendar
            onChange={onChange}
            value={value}
        />
    );
}
